import React, { Component } from 'react';
import "./contact.css"


class Contact extends Component{
    constructor(props){
        super(props);
        this.state = {
            name: '',
            email: '',
            message: ''
        }
    }
    render(){
        return(
            <div className="Contact">
                <h1>This is a contact page here!</h1>

            </div>

        )
    }
}


export default Contact
